import React, { useEffect } from 'react'
import { AccountProvider, useAccounts } from '../../Context/CuentasContexto'
function Vercuentas() {

    const {getCuentas} = useAccounts()

    useEffect(()=>{
        getCuentas()
    },[])


  return (
      <AccountProvider>
    <div>Vercuentas</div>
    </AccountProvider>
  )
}

export default Vercuentas
